
import stored
import notated

class Tuning:
    def __init__(self, tine_semitones, registered_octaves = [0], base_octave=0):
        self.tine_semitones = set(tine_semitones)
        self.tine_count = len(tine_semitones)
        self.registered_octaves = registered_octaves
        self.base_octave = base_octave
        lo = -100
        hi = 100
        self.note_for_semitone = {
            i:i-12*j 
                for j in self.registered_octaves
                for i in range(lo,hi+1)
                if i-12*j in self.tine_semitones
        }
    def format(self, semitones):
        return [self.note_for_semitone[semitone-12*self.base_octave] + 12*self.base_octave 
            for semitone in semitones 
            if (semitone-12*self.base_octave) in self.note_for_semitone]

